const handleErrors = (response) => {
    if(!response.ok){
        const errorMessage = {'error': response.statusText}
        return errorMessage
    }
    return response
}

export default async function getDishCategories(url){
    const respuesta =  await fetch(url)
    const json = await respuesta.json()
    return await json
}
